import React, { Component } from "react";
import axios from "axios";
import { ListGroup, ListGroupItem } from "reactstrap";
import { Table } from "reactstrap";
import ReactDOM from "react-dom";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";

export default class EditProgram extends Component {
  state = {
    data: {
      alesRequirement: true,
      sgkRequirement: true,
      masterRequirement: true,
      quota: 0,
      _id: "",
      name: "",
      department: "",
      degree: "",
      coordinator: "",
      description: "",
      announceDate: "",
      applicationDeadline: "",
      __v: 0,
    },
    datas: [],
    data: [],
  };

  handlechange = (event) => {
    const target = event.target;
    const name = target.name;
    const value = target.value;

    this.setState({
      [name]: value,
    });
  };

  componentWillMount() {
    this.jwtHandler();
  }

  jwtHandler = async () => {
    await axios({
      url: "http://commerchant.herokuapp.com/programs",
      method: "GET",
    })
      .then((response) =>
        this.setState({ datas: response.data.payload.programs })
      )
      .catch(() => console.log("Profil gÃ¶sterilemedi"));
  };

  render() {
    return (
      <div>
        <h2> Edit Program</h2>

        <select id="lang" onChange={this.change} value={this.state.value}>
          {this.state.datas.map((data) => (
            <option value="select">{data.name}</option>
          ))}
          ;
        </select>







        <Form onSubmit={this.submit}>
          <FormGroup>

              <Label for="name">First Name</Label>
              <Input
                type="text"
                name="firstname"
                value={this.state.name}
                placeholder="Enter Your First Name!"
                onChange={this.handlechange}
              />
            </FormGroup>

            <FormGroup>
            <Label for="middlename">Middle Name</Label>
            <Input
              type="text"
              name="middlename"
              value={this.state.username}
              placeholder="Enter Your Middle Name!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="lastname">Last Name</Label>
            <Input
              type="text"
              name="lastname"
              value={this.state.username}
              placeholder="Enter Your Last Name!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="email">Email</Label>
            <Input
              type="email"
              name="email"
              value={this.state.email}
              placeholder="Enter your e-mail!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="password">Password</Label>
            <Input
              type="password"
              value={this.state.password}
              name="password"
              placeholder="Enter Your Password!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="phone">Phone</Label>
            <Input
              type="text"
              pattern="[0-9]*"
              name="phone"
              value={this.state.contact}
              placeholder="Enter Your Phone Number!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="address">Address</Label>
            <Input
              type="text"
              name="address"
              value={this.state.contact}
              placeholder="Enter Your Address!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <ReCAPTCHA
            sitekey="6LeIxAcTAAAAAJcZVRqyHh71UMIEGNQ_MXjiZKhI"
            render= "explicit"
            onChange={this.onloadCallback} 
           />
          <Button>Submit</Button>
        </Form>
      </div>
    );
  }
}
